import React from "react";
import "./SectionTen.css";
import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
// import secImage from "./SectionTenImg.avif";

const data = [
  {
    id: 1,
    img: "./SectionTenImg1",
  },
  {
    id: 2,
    img: "./SectionTenImg",
  },
  {
    id: 3,
    img: "",
  },
];

function SectionTen() {
  return (
    <div>
      <div className="SectionTen">
        <div className="sec1">
          <div className="col2">
            <h4>The Athenaeum</h4>
            <h1>The warm-up </h1>
            <p>
              In The Athenaeum, our digital reading room: a guide to ensuring a
              healthy complexion through the warmer months.
            </p>
            <a href="" className="btn">
              <p>Read more</p>
              <ArrowForwardIcon />
            </a>
          </div>
        </div>
        <div className="sec2">
          {data.map((x) => {
            <div className="col3">
              <div>
                <img src={x.img} alt="" />
              </div>
            </div>;
          })}
        </div>
      </div>
    </div>
  );
}

export default SectionTen;
